import math

def get_common_divisors(A, B):
    if A < B:
        A, B = B, A

    divisors = []
    for i in range(1, math.ceil(math.sqrt(A))+1):
        if A % i == 0:
            if B % i == 0:
                divisors.append(i)
            if B % (A//i) == 0 and i != A//i:
                divisors.append(A//i)

    divisors.sort(reverse=True)
    return divisors

def main():
    A, B, K = map(int, input().split())
    divisors = get_common_divisors(A, B)
    print(divisors[K-1])

if __name__ == '__main__':
    main()
